import React from 'react';

import {useUser} from '../contexts/UserContext';

import Main from './main';
import Auth from './auth';

const Route = () => {

  const {signed} = useUser();

  return (
    <>
    {
      signed 
      ? <Main />
      : <Auth />
    }
    </>
  )
}

export default Route;
